<?phpnamespace Nemundo\WebLog\Install;use Nemundo\App\Application\Setup\ApplicationSetup;use Nemundo\App\Scheduler\Setup\SchedulerSetup;use Nemundo\App\Script\Setup\ScriptSetup;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\App\Application\Type\Install\AbstractInstall;use Nemundo\WebLog\Application\WebLogApplication;use Nemundo\WebLog\Data\WebLogModelCollection;use Nemundo\WebLog\Scheduler\WebLogAnalyzerScheduler;use Nemundo\WebLog\Script\WebLogCleanScript;class WebLogInstall extends AbstractInstall{    public function install()    {        (new ApplicationSetup())->addApplication(new WebLogApplication());        (new ModelCollectionSetup())->addCollection(new WebLogModelCollection());        (new SchedulerSetup(new WebLogApplication()))            ->addScheduler(new WebLogAnalyzerScheduler());        (new ScriptSetup())            ->addScript(new WebLogCleanScript());    }}